import { useState, useEffect } from "react";
import TaskList from "./TaskList";

const Home = () => {

  const[tasks, setTasks] = useState(null)

  useEffect(() => {
    fetch('http://localhost:7000/tasks')
    .then(res => {
      return res.json();
    })
    .then(data => {
      setTasks(data)
    });
  }, []);

    return (
      <div className="home">
        {tasks && <TaskList tasks={tasks}/>}
      </div>
    );
  }
   
  export default Home;
